    false,nt"url": null,nt"notes": "NODC accession 0103918 includes physical
    and underway data collected aboard the ATLANTIS during cruise AT15-63 in the North
    Pacific Ocean and South Pacific Ocean from 2010-03-15 to 2010-04-14. These data
    include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Woods Hole Oceanographic Institution as part of Galu00c3u00a1pagos
    Ridge Undersea Volcanic Eruptions Expedition (GRUVEE). The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
